import os
import pandas

def generate_masterlist(): # Use to update masterlist periodically

    from collections import Counter

    chlist = []
    subdirs= ['Full Sample/48','Full Sample/56','HEV vs ICE/48','HEV vs ICE/56','OLD vs NEW/48','OLD vs NEW/56','THOR']
    for subdir in subdirs:
        print(subdir)
        testframedict = {}
        directory = os.fspath('P:/AHEC/DATA/')
        count = len(os.listdir(directory+subdir))
        i = 1
        for filename in os.listdir(directory+subdir):
            if filename.endswith('.csv'):
                testframe = pandas.read_csv(directory+subdir+'/'+filename)
                chlist.extend(testframe.columns.tolist())
                testframedict[filename[:-9]] = testframe
                per = i/count*100
                i = i+1
                print('%.1f %% Complete' % per)

    chs = Counter(chlist)
    masterlist = [key for i, (key, value) in enumerate(chs.items()) if value > 1]
    print(masterlist)
    return masterlist

