    import re
    starts = []
    ends = []
    groups = []
    for match in re.finditer("\[(.*?)\]", channel):
        starts.append(match.start())
        ends.append(match.end())
        groups.append(match.group()[1:-1].split(','))

    #Transpose groups
    new_groups = []
    for group in groups:
        if group[0].startswith(('!','~')): #catches first ! not others, but they should have or not have ! anyway
            new_group = list(map(list,zip(*group)))
            new_group = [['!'+g for g in group_item] for group_item in new_group[1:]]
            new_groups.append(new_group)
        else:
            new_groups.append(list(map(list,zip(*group))))
    groups = new_groups

    #replace [...] and ? digits in channel with appropriate list objects
    digits = [[] if digit == '?' else [digit] for digit in channel]
    for start, end, group in reversed(list(zip(starts, ends, groups))):
        digits = digits[:start]+group+digits[end:]

    #find digits to inverse match condition
    inverse = [False]*len(digits)
    for k, digit in enumerate(digits):
        if digit and digit[0].startswith('!'): #digit not empty list and has !
            inverse[k] = True
            for j, d in enumerate(digit):
                digit[j] = d[1:]

    #append to temp if match and not prefixed with '!' or '~'
    for k, digit in enumerate(digits):
        reject = inverse[k]

        if digit:
            temp = []
            for ch in chlist:
                if any([ch[k:k+1] == arg for arg in digit]) ^ reject:
                    temp.append(ch)
            chlist = temp

    return chlist

